;; gorilla-repl.fileformat = 1

;; **
;;; # Simple Foreground Background Diff
;;; 
;;; Here we have a background picture and we would like to discover new objects on top of this background.
;;; 
;;; We will use the simple opencv3.core function **absdiff** and then apply a simple and large **threshold** to pick up all the new objects.
;; **

;; **
;;; The reference clojure code file can be found here: [bgdiff.clj](https://github.com/hellonico/opencv-fun/blob/master/test/opencv3/bgdiff.clj)
;;; 
;;; Let's see first what our background looks like. 
;; **

;; @@
(ns scenic-iceberg
  (:require
    [opencv3.core :refer :all]
    [opencv3.utils :as u]))

(def bg (-> "resources/images/bgdiff/header.png" imread (u/resize-by 0.5)))
(u/mat-view bg)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"350\" height=\"245\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4eb2d4da \"BufferedImage@4eb2d4da: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 350 height = 245 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; Then put our hand in front of that background. 
;; **

;; @@
(def fg (-> "resources/images/bgdiff/front.png" imread (u/resize-by 0.5)))
(u/mat-view fg)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"350\" height=\"245\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x134f06de \"BufferedImage@134f06de: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 350 height = 245 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; The **absdiff** function from OpenCV core is used, and we can directly see the output. 
;; **

;; @@
(def output (new-mat))
(absdiff bg fg output)
(u/mat-view output)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"350\" height=\"245\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x775ee3ce \"BufferedImage@775ee3ce: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 350 height = 245 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
; diff in color
(def fg-1
  (-> output
  clone
  (threshold! 10 255 1)))
(u/mat-view fg-1)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"350\" height=\"245\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3077e623 \"BufferedImage@3077e623: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7bfe4554 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 350 height = 245 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; You can then use a very permissive threshold to find out relevant shapes.
;; **

;; @@

; diff in gray
(def fg-2
 (-> output
  clone
  (cvt-color! COLOR_RGB2GRAY)
  (threshold! 10 255 1)))
(u/mat-view fg-2)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"350\" height=\"245\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x64d1021d \"BufferedImage@64d1021d: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@75c6fdd8 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 350 height = 245 #numDataElements 1 dataOff[0] = 0\"]"}
;; <=

;; @@

;; @@
